struct bus_type usb_bus_type = {
.name = "usb",
.match = usb_device_match,
.uevent = usb_uevent,
};Ex：USB 总线注册函数

struct subsys_private *priv;
priv->bus = bus; //usb_bus_type
bus->p = priv; //bus的私有数据
kobject_set_name(&priv->subsys.kobj, "%s", bus->name); //priv->subsys.kobj->name = "usb"
priv->subsys.kobj.kset = bus_kset; //set "bus" as the parent ,so the folder path is /sys/class/bus/usb/
priv->subsys.kobj.ktype = &bus_ktype;
priv->drivers_autoprobe = 1;
kset_register(&priv->subsys); //register /sys/class/bus/usb path in sys
// create uevent file , so we can store a uevent command at will,path with /sys/class/bus/usb/uevent
bus_create_file(bus, &bus_attr_uevent);
// create devices folder, /sys/class/bus/usb/devices
priv->devices_kset = kset_create_and_add("devices", NULL, &priv->subsys.kobj);
// create devices folder, /sys/class/bus/usb/drivers
priv->drivers_kset = kset_create_and_add("drivers", NULL,&priv->subsys.kobj);
// after all bus_register(), /sys/class/bus/usb/drivers and /sys/class/bus/usb/devices is create.
add_probe_files(bus);//创建drivers_probe与drivers_autoprobe文件
bus_add_groups(bus, bus->bus_groups);//创建属性组

udev = usb_alloc_dev(hdev, hdev->bus, port1);
usb_set_device_state(udev, USB_STATE_POWERED);
udev->level = hdev->level + 1;//USB 设备树的级联关系，Root Hub 的 level 就是 0， 其下面一层就是 level1，再下面一层就是 level 2，依此类推
Ex：为一个 USB 设备申请内存空间，为了 Hub 这个端口所接的设备而申请的，设置它的状态为USB_STATE_POWERED

