struct hid_device *hid;
struct usbhid_device *usbhid;
hid = hid_allocate_device();
usb_set_intfdata(intf, hid);
hid->ll_driver = &usb_hid_driver;//绑定usbhid与hid
hid->bus = BUS_USB;
hid->driver_data = usbhid;
usbhid->hid = hid;
usbhid->intf = intf;
usbhid->ifnum = interface->desc.bInterfaceNumber;//接口编号
hid_add_device(hid);//add hid_device

struct hid_device *hdev
hdev->ll_driver->parse(hdev);
Ex：由usb_hid_driver中usbhid_parse()处理

struct hid_driver *hdrv
hdrv->driver.name = hdrv->name;
hdrv->driver.bus = &hid_bus_type;//将驱动绑定到hid总线(hid/hid-core.c)
driver_register(&hdrv->driver);

static const struct hid_device_id mt_devices[] = {
{ HID_DEVICE(HID_BUS_ANY, HID_GROUP_MULTITOUCH, HID_ANY_ID, HID_ANY_ID) },
}
Ex：设备匹配

struct hidraw *dev;
dev->dev = device_create(hidraw_class, &hid->dev, MKDEV(hidraw_major, minor),NULL, "%s%d", "hidraw", minor);
dev->hid = hid;
hid->hidraw = dev;
Ex：创建/dev/hidraw设备节点，绑定hid_device与hidraw

hidraw_class = class_create(THIS_MODULE, "hidraw");
cdev_init(&hidraw_cdev, &hidraw_ops);
cdev_add(&hidraw_cdev, dev_id, HIDRAW_MAX_DEVICES);
Ex：创建字符设备hidraw

struct hid_input *hidinput = NULL;
hidinput = hidinput_allocate(hid);
Ex：hid_input设备分配空间并初始化input_dev设备

}
static inline int __must_check hid_hw_open(struct hid_device *hdev)
{
return hdev->ll_driver->open(hdev);
}
Ex：hidinput_open调用关系

hid_input_field(hid, report->field[a], cdata, interrupt);
hdrv->report(hid, report);//hid-multitouch.c中mt_report()
hidinput_report_event(hid, report);
Ex：通过input子系统报告事件
